    function updateRCLGametypeVocs(value) {

        // удаляем опшены из списка
        clearRCLGametypeVocs();
        // фильтруем совпадения с инпутом в базе
        let filter = filterVocs(value);

        // по первым ста совпадениям создаем опшены
        for (let i = 0; i < 100; i++) {
            try {
                let option = document.createElement('div');
                option.setAttribute('class', 'RCLGametypeOption');
                option.dataset.id = filter[i].id;
                option.textContent = filter[i].text;
                option.addEventListener('click', (e) => {
                    RCLGametype.dataset.id = filter[i].id;
                    RCLGametype.value = filter[i].text;
                    hideOptions();
                });
                RCLGametypeVocs.insert(option);
            } catch (e) {  }
        }
        RCLGametype.style['border-bottom-left-radius'] = '0px';
        RCLGametype.style['border-bottom-right-radius'] = '0px';
        RCLGametypeVocs.style.display = 'block';
        RCLGametypeDiv.style.height = '100%';
    }

    function hideOptions() {

        RCLGametypeVocs.style.removeProperty('display');
        RCLGametypeDiv.style.removeProperty('height');
        RCLGametype.style.removeProperty('border-bottom-left-radius');
        RCLGametype.style.removeProperty('border-bottom-right-radius');
    }

    function clearRCLGametypeVocs() {

        for (let i = RCLGametypeVocs.childElementCount; i > 0; i--) {
            RCLGametypeVocs.childNodes[i - 1].remove();
        }
    }

    function filterVocs(value) {

        let newValue = '';
        // экранируем знаки
        for (char of value)
            char.match(/([a-z]|[0-9])/i) == null ? newValue += ('\\' + char) : newValue += char;
        let re = new RegExp(newValue, 'i');
        return vocList.filter((x) => {
            return x.text.match(re);
        });
    }

    function create() {

        // проверяем ручной ввод айди словаря с $
        // иначе смотрим цифровой айди в датасете
        // иначе берем буквенный айди из датасета
        try {
            if (RCLGametype.value.match(/\B\$/))
                var gametype = 'voc&voc=' + RCLGametype.value.slice(1);
            else {
                if (RCLGametype.dataset.id.match(/(\d+)/))
                    var gametype = 'voc&voc=' + RCLGametype.dataset.id;
                else
                    var gametype = RCLGametype.dataset.id;
            }
        } catch(e) { console.log('gametype init error') }

        // инициализируем чат и ресивим ссылочку
        var gamechatInput = (value) => { document.querySelectorAll('.chat')[1].querySelector('.text').value = value};
        var gamechatSend = () => { document.querySelectorAll('.chat')[1].querySelector('.send').click() };
        var newRaceUrl = httpGet('http://klavogonki.ru/create/?' +
                                 'gametype=' + gametype +
                                 '&type=' + currentMode +
                                 '&level_from=' + RCLMin.value +
                                 '&level_to=' + RCLMax.value +
                                 '&timeout=' + RCLTimeout.value +
                                 '&qual=' + currentQual +
                                 '&submit=1'
                                );

        var qual = 'квалификация, ';
        if(!currentQual)
            var qual = '';

        var privacy = 'открытая';
        if(currentMode == 'private')
           var privacy = 'дружеский';


        console.log(currentGametypeName);
        if ((RCLMin.value == '1') && (RCLMax.value == '9')) {
            var chatInvite = currentGametypeName + ', ' + qual + privacy + ', ' + RCLTimeout.value + ' секунд';
            gamechatInput(newRaceUrl.responseURL + ' ' + chatInvite);
        } else {
            var chatInvite = currentGametypeName + ', ' + qual + privacy + ', ' +
                RCLMin.options[RCLMin.selectedIndex].text + ' — ' +
                RCLMax.options[RCLMax.selectedIndex].text + ', ' +
                RCLTimeout.value + ' секунд';
            gamechatInput(newRaceUrl.responseURL + ' ' + chatInvite);
        }

/*
        if ((RCLMin.value == '1') && (RCLMax.value == '9'))
            gamechatInput(newRaceUrl.responseURL +
                          ' **' + RCLTimeout.value + ' секунд**'
                         );
        else
            gamechatInput(newRaceUrl.responseURL + ' ' +
                          RCLMin.options[RCLMin.selectedIndex].text + ' — ' +
                          RCLMax.options[RCLMax.selectedIndex].text +
                          ' **' + RCLTimeout.value + ' секунд**'
                         );
*/
        gamechatSend();
    }

